es":[{"sourceType":"Competition","sourceId":14242,"databundleVersionId":null,"mountSlug":null}],"sourceType":"notebook","language":"python","isGpuEnabled":true,"isInternetEnabled":false},"source":"{\u0022cells\u0022:[{\u0022metadata\u0022:{},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022# Feature Engineering \\n## ~Almost~ all features of IEEE fraud detectetion dataset \\n\\n\\n## Purpose of the kernel: \\nIn the last week I worked in all features trying to improve my model. I\u0027ve worked in almost all features and I decided to share with the kaggle fellows. \\n\\n### NOTE: Maybe not all features could be useful, but I think that this work could help other kagglers in Data manipulation or to create another interesting feature\\n\u0022},{\u0022metadata\u0022:{},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## \u003cfont color=\\\u0022red\\\u0022\u003ePlease if this kernel were useful for you, please \u003cb\u003eUPVOTE\u003c/b\u003e the kernel\u003c/font\u003e\u0022},{\u0022metadata\u0022:{},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## Importing Libraries\u0022},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u00228f2839f25d086af736a60e9eeb907d3b93b6e0e5\u0022,\u0022_cell_guid\u0022:\u0022b1076dfc-b9ad-4769-8c92-a6c4dae69d19\u0022,\u0022trusted\u0022:true},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022import numpy as np # linear algebra\\nimport pandas as pd # data processing, CSV file I/O (e.g. pd.read_csv)\\nimport scipy as sp\\nfrom scipy import stats\\nimport matplotlib.pyplot as plt\\nimport seaborn as sns\\n\\n# Standard plotly imports\\n#import plotly.plotly as py\\nimport plotly.graph_objs as go\\nimport plotly.tools as tls\\nfrom plotly.offline import iplot, init_notebook_mode\\n#import cufflinks\\n#import cufflinks as cf\\nimport plotly.figure_factory as ff\\n\\n# Using plotly + cufflinks in offline mode\\ninit_notebook_mode(connected=True)\\n#cufflinks.go_offline(connected=True)\\n\\n# Preprocessing, modelling and evaluating\\nfrom sklearn import preprocessing\\nfrom sklearn.metrics import confusion_matrix, roc_auc_score\\nfrom sklearn.model_selection import StratifiedKFold, cross_val_score, KFold\\nfrom xgboost import XGBClassifier\\nimport xgboost as xgb\\n\\nfrom sklearn.preprocessing import minmax_scale\\nfrom sklearn.decomposition import PCA\\nfrom sklearn.cluster import KMeans\\nfrom scipy.spatial.distance import cdist, pdist\\n\\n\\n## Hyperopt modules\\nfrom hyperopt import fmin, hp, tpe, Trials, space_eval, STATUS_OK, STATUS_RUNNING\\nfrom functools import partial\\n\\nimport os\\nimport gc\\nprint(os.listdir(\\\u0022../input\\\u0022))\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## Some functions\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022## Function to reduce the DF size\\ndef reduce_mem_usage(df, verbose=True):\\n    numerics = [\u0027int16\u0027, \u0027int32\u0027, \u0027int64\u0027, \u0027float16\u0027, \u0027float32\u0027, \u0027float64\u0027]\\n    start_mem = df.memory_usage().sum() / 1024**2    \\n    for col in df.columns:\\n        col_type = df[col].dtypes\\n        if col_type in numerics:\\n            c_min = df[col].min()\\n            c_max = df[col].max()\\n            if str(col_type)[:3] == \u0027int\u0027:\\n                if c_min \u003e np.iinfo(np.int8).min and c_max \u003c np.iinfo(np.int8).max:\\n                    df[col] = df[col].astype(np.int8)\\n                elif c_min \u003e np.iinfo(np.int16).min and c_max \u003c np.iinfo(np.int16).max:\\n                    df[col] = df[col].astype(np.int16)\\n                elif c_min \u003e np.iinfo(np.int32).min and c_max \u003c np.iinfo(np.int32).max:\\n                    df[col] = df[col].astype(np.int32)\\n                elif c_min \u003e np.iinfo(np.int64).mi 027learning_rate\u0027: \\\u0022{:.3f}\\\u0022.format(params[\u0027learning_rate\u0027]),\\n        \u0027num_leaves\u0027: \u0027{:.3f}\u0027.format(params[\u0027num_leaves\u0027]),\\n        \u0027colsample_bytree\u0027: \u0027{:.3f}\u0027.format(params[\u0027colsample_bytree\u0027]),\\n        \u0027min_child_samples\u0027: \u0027{:.3f}\u0027.format(params[\u0027min_child_samples\u0027]),\\n        \u0027feature_fraction\u0027: \u0027{:.3f}\u0027.format(params[\u0027feature_fraction\u0027]),\\n        \u0027bagging_fraction\u0027: \u0027{:.3f}\u0027.format(params[\u0027bagging_fraction\u0027])\\n    }\\n\\n    print(\\\u0022\\\\n############## New Run ################\\\u0022)\\n    print(f\\\u0022params = {params}\\\u0022)\\n    FOLDS = 3\\n    count=1\\n    skf = StratifiedKFold(n_splits=FOLDS, shuffle=True, random_state=42)\\n    tss = TimeSeriesSplit(n_splits=FOLDS)\\n    \\n    score_mean = 0\\n    for tr_idx, val_idx in skf.split(X_train, y_train):\\n        clf = xgb.XGBClassifier(\\n            n_estimators=1000, random_state=4, verbose=True, \\n            tree_method=\u0027gpu_hist\u0027, \\n            **params\\n        )\\n\\n        X_tr, X_vl = X_train.iloc[tr_idx, :], X_train.iloc[val_idx, :]\\n        y_tr, y_vl = y_train.iloc[tr_idx], y_train.iloc[val_idx]\\n        \\n        clf.fit(X_tr, y_tr)\\n        #y_pred_train = clf.predict_proba(X_vl)[:,1]\\n        #print(y_pred_train)\\n        score = make_scorer(roc_auc_score, needs_proba=True)(clf, X_vl, y_vl)\\n        # plt.show()\\n        score_mean += score\\n        print(f\u0027{count} CV - score: {round(score, 4)}\u0027)\\n        count += 1\\n    time2 = time.time() - time1\\n    print(f\\\u0022Total Time Run: {round(time2 / 60,2)}\\\u0022)\\n    gc.collect()\\n    print(f\u0027Mean ROC_AUC: {score_mean / FOLDS}\u0027)\\n    del X_tr, X_vl, y_tr, y_vl, clf, score\\n    return -(score_mean / FOLDS)\\n\\n\\nspace = {\\n    # The maximum depth of a tree, same as GBM.\\n    # Used to control over-fitting as higher depth will allow model \\n    # to learn relations very specific to a particular sample.\\n    # Should be tuned using CV.\\n    # Typical values: 3-10\\n    \u0027max_depth\u0027: hp.quniform(\u0027max_depth\u0027, 7, 20, 1),\\n    \\n    # reg_alpha: L1 regularization term. L1 regularization encourages sparsity \\n    # (meaning pulling weights to 0). It can be more useful when the objective\\n    # is logistic regression since you might need help with feature selection.\\n    \u0027reg_alpha\u0027:  hp.uniform(\u0027reg_alpha\u0027, 0.01, 0.4),\\n    \\n    # reg_lambda: L2 regularization term. L2 encourages smaller weights, this\\n    # approach can be more useful in tree-models where zeroing \\n    # features might not make much sense.\\n    \u0027reg_lambda\u0027: hp.uniform(\u0027reg_lambda\u0027, 0.01, .4),\\n    \\n    # eta: Analogous to learning rate in GBM\\n    # Makes the model more robust by shrinking the weights on each step\\n    # Typical final values to be used: 0.01-0.2\\n    \u0027learning_rate\u0027: hp.uniform(\u0027learning_rate\u0027, 0.01, 0.2),\\n    \\n    # colsample_bytree: Similar to max_features in GBM. Denotes the \\n    # fraction of columns to be randomly samples for each tree.\\n    # Typical values: 0.5-1\\n    \u0027colsample_bytree\u0027: hp.uniform(\u0027colsample_bytree\u0027, 0.3, .9),\\n    \\n    # A node is split only when the resulting split gives a positive\\n    # reduction in the loss function. Gamma specifies the \\n    # minimum loss reduction required to make a split.\\n    # Makes the algorithm conservative. The values can vary depending on the loss function and should be tuned.\\n    \u0027gamma\u0027: hp.uniform(\u0027gamma\u0027, 0.01, 1),\\n    \\n    # more increases accuracy, but may lead to overfitting.\\n    # num_leaves: the number of leaf nodes to use. Having a large number \\n    # of leaves will improve accuracy, but will also lead to overfitting.\\n    \u0027num_leaves\u0027: hp.choice(\u0027num_leaves\u0027, list(range(20, 250, 10))),\\n    \\n    # specifies the minimum samples per leaf node.\\n    # the minimum number of samples (data) to group into a leaf. \\n    # The parameter can greatly assist with overfitting: larger sample\\n    # sizes per leaf will reduce overfitting (but may lead to under-fitting).\\n    \u0027min_child_samples\u0027: hp.choice(\u0027min_child_samples\u0027, list(range(20, 200, 10))),\\n    \\n    # subsample: represents a fraction of the rows (observations) to be \\n    # considered when building each subtree. Tianqi Chen and Carlos Guestrin\\n    # in their paper A Scalable Tree Boosting System recommend \\n    \u0027subsample\u0027: hp.choice(\u0027subsample\u0027, [0.3, 0.4, 0.5, 0.6, 0.7, .8, .9]),\\n    \\n    # randomly select a fraction of the features.\\n    # feature_fraction: controls the subsampling of features used\\n    # for training (as opposed to subsampling the actual training data in \\n    # the case of bagging). Smaller fractions reduce overfitting.\\n    \u0027feature_fraction\u0027: hp.uniform(\u0027feature_fraction\u0027, 0.4, .8),\\n    \\n    # randomly bag or subsample training data.\\n    \u0027bagging_fraction\u0027: hp.uniform(\u0027bagging_fraction\u0027, 0.4, .9)\\n    \\n    # bagging_fraction and bagging_freq: enables bagging (subsampling) \\n    # of the training data. Both values need to be set for bagging to be used.\\n    # The frequency controls how often (iteration) bagging is used. Smaller\\n    # fractions and frequencies reduce overfitting.\\n}\\n\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## Running HyperOpt\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_kg_hide-output\u0022:true},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022best = fmin(fn=objective,\\n            space=space,\\n            algo=tpe.suggest,\\n            max_evals=30, \\n            # trials=trials\\n           )\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022- to see running outputs click in \\\u0022show code\\\u0022 in the code above\u0022},{\u0022metadata\u0022:{},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## Best parameters\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022from hyperopt import space_eval\\n\\nbest_params = space_eval(space, best)\\nbest_params\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## Predicting with the best parameters \u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022best_params[\u0027max_depth\u0027] = int(best_params[\u0027max_depth\u0027])\\n\\nclf = xgb.XGBClassifier(\\n        n_estimators=1000, random_state=4,\\n        tree_method=\u0027gpu_hist\u0027, \\n        **best_params\\n        )\\n\\nclf.fit(X_train, y_train)\\n\\ny_preds= clf.predict_proba(X_test)[:,1]\\n\\nsample_submission[\u0027isFraud\u0027] = y_preds\\nsample_submission.to_csv(\u0027xgb_full_feat_eng.csv\u0027)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## I hope you enjoyned the kernel. \\n## I will work in different features and publish trought this kernel.\\n# Stay tuned and please give me your feedback and upvote the kernel =)\\nI\u0027m not a ML pro, so your feedback is very important. \u0022}],\u0022metadata\u0022:{\u0022kernelspec\u0022:{\u0022display_name\u0022:\u0022Python 3\u0022,\u0022language\u0022:\u0022python\u0022,\u0022name\u0022:\u0022python3\u0022},\u0022language_info\u0022:{\u0022name\u0022:\u0022python\u0022,\u0022version\u0022:\u00223.6.4\u0022,\u0022mimetype\u0022:\u0022text/x-python\u0022,\u0022codemirror_mode\u0022:{\u0022name\u0022:\u0022ipython\u0022,\u0022version\u0022:3},\u0022pygments_lexer\u0022:\u0022ipython3\u0022,\u0022nbconvert_exporter\u0022:\u0022python\u0022,\u0022file_extension\u0022:\u0022.py\u0022}},\u0022nbformat\u0022:4,\u0022nbformat_minor\u0022:1}","dateCreated":"2019-08-08T01:28:43.4107477Z"},"kernelRun":{"id":18503862,"kernelId":5107240,"status":"complete","type":"batch","sourceType":"notebook","language":"python","title":"~Almost~ complete Feature Engineering IEEE data","dateCreated":"2019-08-08T01:28:43.917Z","dateEvaluated":"2019-08-08T01:28:44.9Z","workerContainerPort":null,"workerUptimeSeconds":114019,"workerIPAddress":"172.20.2.173   ","workerIPAddressExternal":null,"scriptLanguageId":9,"scriptLanguageName":"IPython Notebook HTML","renderedOutputUrl":"https://www.kaggleusercontent.com/kf/18503862/eyJhbGciOiJkaXIiLCJlbmMiOiJBMTI4Q0JDLUhTMjU2In0.._xy818CKijMV3q51dpQ5uQ.loGdWNbjt4wWFvB5jhO9PG2bKzwOBUqizqo3B1HIRZhz8c75Z8pdzx-JDkYsu2Z9aeCSR6GMto723lwpMfUfBbAGNX0Wu6NIH-ql0i0jx7TiuF7CVG23-v8hVa9-CtlivyuuEZIzn2sz794S8WmI7csuRWifYNpC39qvPm7rqhs.9vEdmWYR6iu6zUyFrfcGGw/__results__.html","commit":{"id":460662292,"settings":{"dockerImageVersionId":null,"dataSources":[{"sourceType":"Competition","sourceId":14242,"databundleVersionId":null,"mountSlug":null}],"sourceType":"notebook","language":"python","isGpuEnabled":true,"isInternetEnabled":false},"source":"{\u0022cells\u0022:[{\u0022metadata\u0022:{},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022# Feature Engineering \\n## ~Almost~ all features of IEEE fraud detectetion dataset \\n\\n\\n## Purpose of the kernel: \\nIn the last week I worked in all features trying to improve my model. I\u0027ve worked in almost all features and I decided to share with the kaggle fellows. \\n\\n### NOTE: Maybe not all features could be useful, but I think that this work could help other kagglers in Data manipulation or to create another interesting feature\\n\u0022},{\u0022metadata\u0022:{},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## \u003cfont color=\\\u0022red\\\u0022\u003ePlease if this kernel were useful for you, please \u003cb\u003eUPVOTE\u003c/b\u003e the kernel\u003c/font\u003e\u0022},{\u0022metadata\u0022:{},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## Importing Libraries\u0022},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u00228f2839f25d086af736a60e9eeb907d3b93b6e0e5\u0022,\u0022_cell_guid\u0022:\u0022b1076dfc-b9ad-4769-8c92-a6c4dae69d19\u0022,\u0022trusted\u0022:true},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022import numpy as np # linear algebra\\nimport pandas as pd # data processing, CSV file I/O (e.g. pd.read_csv)\\nimport scipy as sp\\nfrom scipy import stats\\nimport matplotlib.pyplot as plt\\nimport seaborn as sns\\n\\n# Standard plotly imports\\n#import plotly.plotly as py\\nimport plotly.graph_objs as go\\nimport plotly.tools as tls\\nfrom plotly.offline import iplot, init_notebook_mode\\n#import cufflinks\\n#import cufflinks as cf\\nimport plotly.figure_factory as ff\\n\\n# Using plotly + cufflinks in offline mode\\ninit_notebook_mode(connected=True)\\n#cufflinks.go_offline(connected=True)\\n\\n# Preprocessing, modelling and evaluating\\nfrom sklearn import preprocessing\\nfrom sklearn.metrics import confusion_matrix, roc_auc_score\\nfrom sklearn.model_selection import StratifiedKFold, cross_val_score, KFold\\nfrom xgboost import XGBClassifier\\nimport xgboost as xgb\\n\\nfrom sklearn.preprocessing import minmax_scale\\nfrom sklearn.decomposition import PCA\\nfrom sklearn.cluster import KMeans\\nfrom scipy.spatial.distance import cdist, pdist\\n\\n\\n## Hyperopt modules\\nfrom hyperopt import fmin, hp, tpe, Trials, space_eval, STATUS_OK, STATUS_RUNNING\\nfrom functools import partial\\n\\nimport os\\nimport gc\\nprint(os.listdir(\\\u0022../input\\\u0022))\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## Some functions\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022## Function to reduce the DF size\\ndef reduce_mem_usage(df, verbose=True):\\n    numerics = [\u0027int16\u0027, \u0027int32\u0027, \u0027int64\u0027, \u0027float16\u0027, \u0027float32\u0027, \u0027float64\u0027]\\n    start_mem = df.memory_usage().sum() / 1024**2    \\n    for col in df.columns:\\n        col_type = df[col].dtypes\\n        if col_type in numerics:\\n            c_min = df[col].min()\\n            c_max = df[col].max()\\n            if str(col_type)[:3] == \u0027int\u0027:\\n                if c_min \u003e np.iinfo(np.int8).min and c_max \u003c np.iinfo(np.int8).max:\\n                    df[col] = df[col].astype(np.int8)\\n                elif c_min \u003e np.iinfo(np.int16).min and c_max \u003c np.iinfo(np.int16).max:\\n                    df[col] = df[col].astype(np.int16)\\n                elif c_min \u003e np.iinfo(np.int32).min and c_max \u003c np.iinfo(np.int32).max:\\n                    df[col] = df[col].astype(np.int32)\\n                elif c_min \u003e np.iinfo(np.int64).min and c_max \u003c np.iinfo(np.int64).max:\\n                    df[col] = df[col].astype(np.int64)  \\n            else:\\n                if c_min \u003e np.finfo(np.float16).min and c_max \u003c np.finfo(np.float16).max:\\n                    df[col] = df[col].astype(np.float16)\\n                elif c_min \u003e np.finfo(np.float32).min and c_max \u003c np.finfo(np.float32).max:\\n                    df[col] = df[col].astype(np.float32)\\n                else:\\n                    df[col] = df[col].astype(np.float64)    \\n    end_mem = df.memory_usage().sum() / 1024**2\\n    if verbose: print(\u0027Mem. usage decreased to {:5.2f} Mb ({:.1f}% reduction)\u0027.format(end_mem, 100 * (start_mem - end_mem) / start_mem))\\n    return df\\n\\ndef PCA_change(df, cols, n_components, prefix=\u0027PCA_\u0027, rand_seed=4):\\n    pca = PCA(n_components=n_components, random_state=rand_seed)\\n\\n    principalComponents = pca.fit_transform(df[cols])\\n\\n    principalDf = pd.DataFrame(principalComponents)\\n\\n    df.drop(cols, axis=1, inplace=True)\\n\\n    principalDf.rename(columns=lambda x: str(prefix)+str(x), inplace=True)\\n\\n    df = pd.concat([df, principalDf], axis=1)\\n    \\n    return df\\n\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_cell_guid\u0022:\u002279c7e3d0-c299-4dcb-8224-4455121ee9b0\u0022,\u0022_uuid\u0022:\u0022d629ff2d2480ee46fbb7e2d37f6b5fab8052498a\u0022,\u0022trusted\u0022:true},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022df_trans = pd.read_csv(\u0027../input/train_transaction.csv\u0027, index_col=\u0027TransactionID\u0027)\\ndf_test_trans = pd.read_csv(\u0027../input/test_transaction.csv\u0027, index_col=\u0027TransactionID\u0027)\\n\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022df_trans = reduce_mem_usage(df_trans)\\ndf_test_trans = reduce_mem_usage(df_test_trans)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## Concatenating train and test\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022labels = {np.nan: -999, \u0027nan\u0027: -999, \u0027t\u0027: 1, \u0027f\u0027: 2, \u0027m2\u0027: 3, \u0027m0\u0027: 4, \\n          \u0027m1\u0027: 5, \u0027gmail.com\u0027: 6, \u0027outlook.com\u0027: 7, \u0027yahoo.com\u0027: 8, \\n          \u0027mail.com\u0027: 9, \u0027anonymous.com\u0027: 10, \u0027hotmail.com\u0027: 11, \u0027verizon.net\u in_suffix\u0027]\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022for col in cat_cols:\\n    if col in df_train.columns:\\n        le = preprocessing.LabelEncoder()\\n        le.fit(list(df_train[col].astype(str).values) + list(df_test[col].astype(str).values))\\n        df_train[col] = le.transform(list(df_train[col].astype(str).values))\\n        df_test[col] = le.transform(list(df_test[col].astype(str).values))   \u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022## Filling Dist1 Nan\u0027s\\ndf_train[\u0027dist1\u0027] = df_train[\u0027dist1\u0027].fillna(-1)\\ndf_test[\u0027dist1\u0027] = df_test[\u0027dist1\u0027].fillna(-1)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022df_train.drop(\\\u0022Date\\\u0022, axis=1, inplace=True)\\ndf_test.drop(\\\u0022Date\\\u0022, axis=1, inplace=True)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022# Feature selection \\n- I will use the correlation to drop some features that are high correlated with each other\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022threshold = 0.98\\n    \\n# Absolute value correlation matrix\\ncorr_matrix = df_train[df_train[\u0027isFraud\u0027].notnull()].corr().abs()\\n\\n# Getting the upper triangle of correlations\\nupper = corr_matrix.where(np.triu(np.ones(corr_matrix.shape), k=1).astype(np.bool))\\n\\n# Select columns with correlations above threshold\\nto_drop = [column for column in upper.columns if any(upper[column] \u003e threshold)]\\n\\nto_drop.remove(\u0027TransactionDT\u0027)\\n\\ndf_train = df_train.drop(columns = to_drop)\\ndf_test = df_test.drop(columns = to_drop)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## Setting X and y\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022\\nX_train = df_train.sort_values(\u0027TransactionDT\u0027).drop([\u0027isFraud\u0027, \\n                                                      \u0027TransactionDT\u0027, \\n                                                      \u0027Card_ID\u0027\\n                                                     ],\\n                                                     axis=1)\\ny_train = df_train.sort_values(\u0027TransactionDT\u0027)[\u0027isFraud\u0027].astype(bool)\\n\\nX_test = df_test.sort_values(\u0027TransactionDT\u0027).drop([\u0027TransactionDT\u0027,\\n                                                    \u0027Card_ID\u0027\\n                                                   ], \\n                                                   axis=1)\\ndel df_train\\ndf_test = df_test[[\\\u0022TransactionDT\\\u0022]]\\n\\nimport gc\\ngc.collect()\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022X_train = reduce_mem_usage(X_train)\\nX_test = reduce_mem_usage(X_test)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## Shape of last datasets\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022print(X_train.shape)\\nprint(X_test.shape)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022from sklearn.model_selection import KFold\\nfrom sklearn.metrics import roc_auc_score\\nfrom xgboost import plot_importance\\nfrom sklearn.metrics import make_scorer\\nimport time\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## Defining the objective function that will try optimize\\n- testing sk fold and timeseriessplit\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022from sklearn.model_selection import KFold,TimeSeriesSplit\\nfrom sklearn.metrics import roc_auc_score\\nfrom xgboost import plot_importance\\nfrom sklearn.metrics import make_scorer\\n\\nimport time\\ndef objective(params):\\n    time1 = time.time()\\n    params = {\\n        \u0027max_depth\u0027: int(params[\u0027max_depth\u0027]),\\n        \u0027gamma\u0027: \\\u0022{:.3f}\\\u0022.format(params[\u0027gamma\u0027]),\\n        \u0027subsample\u0027: \\\u0022{:.2f}\\\u0022.format(params[\u0027subsample\u0027]),\\n        \u0027reg_alpha\u0027: \\\u0022{:.3f}\\\u0022.format(params[\u0027reg_alpha\u0027]),\\n        \u0027reg_lambda\u0027: \\\u0022{:.3f}\\\u0022.format(params[\u0027reg_lambda\u0027]),\\n        \u0027learning_rate\u0027: \\\u0022{:.3f}\\\u0022.format(params[\u0027learning_rate\u0027]),\\n        \u0027num_leaves\u0027: \u0027{:.3f}\u0027.format(params[\u0027num_leaves\u0027]),\\n        \u0027colsample_bytree\u0027: \u0027{:.3f}\u0027.format(params[\u0027colsample_bytree\u0027]),\\n        \u0027min_child_samples\u0027: \u0027{:.3f}\u0027.format(params[\u0027min_child_samples\u0027]),\\n        \u0027feature_fraction\u0027: \u0027{:.3f}\u0027.format(params[\u0027feature_fraction\u0027]),\\n        \u0027bagging_fraction\u0027: \u0027{:.3f}\u0027.format(params[\u0027bagging_fraction\u0027])\\n    }\\n\\n    print(\\\u0022\\\\n############## New Run ################\\\u0022)\\n    print(f\\\u0022params = {params}\\\u0022)\\n    FOLDS = 3\\n    count=1\\n    skf = StratifiedKFold(n_splits=FOLDS, shuffle=True, random_state=42)\\n    tss = TimeSeriesSplit(n_splits=FOLDS)\\n    \\n    score_mean = 0\\n    for tr_idx, val_idx in skf.split(X_train, y_train):\\n        clf = xgb.XGBClassifier(\\n            n_estimators=1000, random_state=4, verbose=True, \\n            tree_method=\u0027gpu_hist\u0027, \\n            **params\\n        )\\n\\n        X_tr, X_vl = X_train.iloc[tr_idx, :], X_train.iloc[val_idx, :]\\n        y_tr, y_vl = y_train.iloc[tr_idx], y_train.iloc[val_idx]\\n        \\n        clf.fit(X_tr, y_tr)\\n        #y_pred_train = clf.predict_proba(X_vl)[:,1]\\n        #print(y_pred_train)\\n        score = make_scorer(roc_auc_score, needs_proba=True)(clf, X_vl, y_vl)\\n        # plt.show()\\n        score_mean += score\\n        print(f\u0027{count} CV - score: {round(score, 4)}\u0027)\\n        count += 1\\n    time2 = time.time() - time1\\n    print(f\\\u0022Total Time Run: {round(time2 / 60,2)}\\\u0022)\\n    gc.collect()\\n    print(f\u0027Mean ROC_AUC: {score_mean / FOLDS}\u0027)\\n    del X_tr, X_vl, y_tr, y_vl, clf, score\\n    return -(score_mean / FOLDS)\\n\\n\\nspace = {\\n    # The maximum depth of a tree, same as GBM.\\n    # Used to control over-fitting as higher depth will allow model \\n    # to learn relations very specific to a particular sample.\\n    # Should be tuned using CV.\\n    # Typical values: 3-10\\n    \u0027max_depth\u0027: hp.quniform(\u0027max_depth\u0027, 7, 20, 1),\\n    \\n    # reg_alpha: L1 regularization term. L1 regularization encourages sparsity \\n    # (meaning pulling weights to 0). It can be more useful when the objective\\n    # is logistic regression since you might need help with feature selection.\\n    \u0027reg_alpha\u0027:  hp.uniform(\u0027reg_alpha\u0027, 0.01, 0.4),\\n    \\n    # reg_lambda: L2 regularization term. L2 encourages smaller weights, this\\n    # approach can be more useful in tree-models where zeroing \\n    # features might not make much sense.\\n    \u0027reg_lambda\u0027: hp.uniform(\u0027reg_lambda\u0027, 0.01, .4),\\n    \\n    # eta: Analogous to learning rate in GBM\\n    # Makes the model more robust by shrinking the weights on each step\\n    # Typical final values to be used: 0.01-0.2\\n    \u0027learning_rate\u0027: hp.uniform(\u0027learning_rate\u0027, 0.01, 0.2),\\n    \\n    # colsample_bytree: Similar to max_features in GBM. Denotes the \\n    # fraction of columns to be randomly samples for each tree.\\n    # Typical values: 0.5-1\\n    \u0027colsample_bytree\u0027: hp.uniform(\u0027colsample_bytree\u0027, 0.3, .9),\\n    \\n    # A node is split only when the resulting split gives a positive\\n    # reduction in the loss function. Gamma specifies the \\n    # minimum loss reduction required to make a split.\\n    # Makes the algorithm conservative. The values can vary depending on the loss function and should be tuned.\\n    \u0027gamma\u0027: hp.uniform(\u0027gamma\u0027, 0.01, 1),\\n    \\n    # more increases accuracy, but may lead to overfitting.\\n    # num_leaves: the number of leaf nodes to use. Having a large number \\n    # of leaves will improve accuracy, but will also lead to overfitting.\\n    \u0027num_leaves\u0027: hp.choice(\u0027num_leaves\u0027, list(range(20, 250, 10))),\\n    \\n    # specifies the minimum samples per leaf node.\\n    # the minimum number of samples (data) to group into a leaf. \\n    # The parameter can greatly assist with overfitting: larger sample\\n    # sizes per leaf will reduce overfitting (but may lead to under-fitting).\\n    \u0027min_child_samples\u0027: hp.choice(\u0027min_child_samples\u0027, list(range(20, 200, 10))),\\n    \\n    # subsample: represents a fraction of the rows (observations) to be \\n    # considered when building each subtree. Tianqi Chen and Carlos Guestrin\\n    # in their paper A Scalable Tree Boosting System recommend \\n    \u0027subsample\u0027: hp.choice(\u0027subsample\u0027, [0.3, 0.4, 0.5, 0.6, 0.7, .8, .9]),\\n    \\n    # randomly select a fraction of the features.\\n    # feature_fraction: controls the subsampling of features used\\n    # for training (as opposed to subsampling the actual training data in \\n    # the case of bagging). Smaller fractions reduce overfitting.\\n    \u0027feature_fraction\u0027: hp.uniform(\u0027feature_fraction\u0027, 0.4, .8),\\n    \\n    # randomly bag or subsample training data.\\n    \u0027bagging_fraction\u0027: hp.uniform(\u0027bagging_fraction\u0027, 0.4, .9)\\n    \\n    # bagging_fraction and bagging_freq: enables bagging (subsampling) \\n    # of the training data. Both values need to be set for bagging to be used.\\n    # The frequency controls how often (iteration) bagging is used. Smaller\\n    # fractions and frequencies reduce overfitting.\\n}\\n\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## Running HyperOpt\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_kg_hide-output\u0022:true},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022best = fmin(fn=objective,\\n            space=space,\\n            algo=tpe.suggest,\\n            max_evals=30, \\n            # trials=trials\\n           )\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022- to see running outputs click in \\\u0022show code\\\u0022 in the code above\u0022},{\u0022metadata\u0022:{},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## Best parameters\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022from hyperopt import space_eval\\n\\nbest_params = space_eval(space, best)\\nbest_params\u0022,\u0022execution_count
